import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load and click first product's "Add to Cart" button
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_products_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_products_loaded.png'));

    // Extract product information before adding to cart
    const productTitle = await page.$eval('.product-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-price', el => {
      const text = el.textContent.trim();
      return text.match(/\$\d+\.\d+/)[0]; // Extract price like $1199.99
    });

    // Click the first "Add to Cart" button
    await page.click('.add-to-cart:not([disabled])');

    // Wait for cart update and take final screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_cart.png'));

    return {
      success: true,
      action: "Added first product to cart",
      extractedData: {
        productTitle,
        productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
